      <div className="labwork3-main-content">
        <nav className="labwork3-sidebar">
          <ul>
            <li>–ì–æ–ª–æ–≤–Ω–∞</li>
            <li>YouTube Shorts</li>
            <li>–ü—ñ–¥–ø–∏—Å–∫–∏</li>
            <li>YouTube Music</li>
            <li>–Ü—Å—Ç–æ—Ä—ñ—è</li>
            <li>–ü–µ—Ä–µ–≥–ª—è–Ω—É—Ç–∏ –ø—ñ–∑–Ω—ñ—à–µ</li>
          </ul>
        </nav>

        <section className="labwork3-video-grid">
          {videos.map(video => (
            <div className="labwork3-video-item" key={video.id}>
              <img src={video.image} alt={video.title} />
              <h3>{video.title}</h3>
            </div>
          ))}
        </section>
      </div>
    </div>
  );
};

export default LabWork3;
